import { movies } from "./data/movies"

function App() {
  return (
    <div>
      <h1>영화 목록</h1>
      <ul>
        {movies.results.map(movie => (
          <li key={movie.id}>{movie.title}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
